var self = this;
export default () => {
    // eslint-disable-line no-restricted-globals
    self.addEventListener("message", message => {
        if (!message) return;
        const stop = message.data[1]
        const nodesInShortestPathOrder = [];

        if(!stop) {
            let currentNode = message.data[0]
            while (currentNode !== null) {

                if(currentNode.isStart==true) break;

                nodesInShortestPathOrder.unshift(currentNode);
                currentNode = currentNode.previousNode;
            }
            postMessage(nodesInShortestPathOrder)
        } else {
            var firstPath = []
            var secondPath = []
            let currentNode = message.data[0][1].slice(-1)[0]
            let currentNodeStop = message.data[0][0][0]
            while (currentNode !== null) {

                if(currentNode.isStop==true) break;

                firstPath.unshift(currentNode);
                currentNode = currentNode.previousNode;
            }

